import React from 'react';
import '../styles/Skills.css'; // Assuming Skills.css is in the same directory

const skills = [
  'JavaScript',
  'TypeScript',
  'Python',
  'React',
  'C#',
  'C',
  'C++',
  'WordPress',
  'Flask',
  'Java',
  'Kotlin',
  'SQL',
  'Bootstrap',
  'Vue.js',
  'ASP.NET',
];

const Skills = () => {
  const handleClick = (skill) => {
    console.log(`You clicked on ${skill}`);
    // You can replace the console.log with more specific actions here
    //  (e.g., open a modal with detailed information about the skill)
  };

  return (
    <section id="skills">
      <h2>My Skills</h2>
      <div className="skill-container">
        {skills.map((skill) => (
          <button key={skill} className="skill-button" onClick={() => handleClick(skill)}>
            {skill}
          </button>
        ))}
      </div>
    </section>
  );
};

export default Skills;
